import React, { useState, useEffect } from "react";
import axios from "axios";
import {
  TableBody,
  TableContainer,
  Table,
  TableHeader,
  TableCell,
  TableRow,
  TableFooter,
  Avatar,
  Badge,
  Pagination,
} from "@windmill/react-ui";

const OrdersTable = ({ resultsPerPage, filter }) => {
  const [page, setPage] = useState(1);
  const [data, setData] = useState([]);
  const [totalResults, setTotalResults] = useState(0);
  const token = localStorage.getItem('accessToken')

  // pagination change control
  function onPageChange(p) {
    setPage(p);
  }

  const fetchData = async () => {
    try {
      const config = {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      };
      const response = await axios.get("http://localhost:8080/api/orders/all", config);
      const ordersData = response.data;
      console.log(response.data)

      // Apply filters if necessary
      let filteredData = ordersData;
      if (filter === "paid") {
        filteredData = ordersData.filter(order => order.status === "Paid");
      } else if (filter === "un-paid") {
        filteredData = ordersData.filter(order => order.status === "Un-paid");
      } else if (filter === "Изпълнява") {
        filteredData = ordersData.filter(order => order.status === "WORKING_ON");
      }

      // Flatten the groups and update the totalResults and data state
      const flattenedGroups = filteredData.flatMap(order => order.groups);
      setTotalResults(flattenedGroups.length);
      setData(flattenedGroups.slice((page - 1) * resultsPerPage, page * resultsPerPage));
    } catch (error) {
      console.error("Error fetching data:", error);
    }
  };

  useEffect(() => {
    fetchData();
  }, [page, resultsPerPage, filter]);

  return (
    <div>
      {/* Table */}
      <TableContainer className="mb-8">
        <Table>
          <TableHeader>
            <tr>
              <TableCell>Потребител</TableCell>
              <TableCell>Amount</TableCell>
              <TableCell>Status</TableCell>
              <TableCell>Type</TableCell>
              <TableCell>Date</TableCell>
              <TableCell>Date</TableCell>

              <TableCell>Date</TableCell>

              <TableCell>Date</TableCell>
              <TableCell>Date</TableCell>

              <TableCell>Date</TableCell>

              <TableCell>Date</TableCell>

            </tr>
          </TableHeader>
          <TableBody>

            {data.map((order, ) => (
              <TableRow key={order.id}>
                 <TableCell>
                  <div className="flex items-center text-sm">
                    <div>
                      {/* <p className="font-semibold">{order.user.username}</p> */}
                    </div>
                  </div>
                </TableCell>
                <TableCell>100</TableCell>
                <TableCell>{order.status}</TableCell>
                <TableCell>{order.type}</TableCell>
                <TableCell>
                  <Badge
                    type={
                      order.status === "Un-paid"
                        ? "danger"
                        : order.status === "Paid"
                        ? "success"
                        : order.status === "WORKING_ON"
                        ? "warning"
                        : "neutral"
                    }
                  >
                    {order.status === "WORKING_ON" ? "Изпълнява" : order.status}
                  </Badge>
                </TableCell>
                <TableCell>
                  {order.type === "BY_HAND" ? "Ръчно" : "Друго"}
                </TableCell>
                <TableCell>
                  {new Date(order.date).toLocaleDateString()}
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
        <TableFooter>
          <Pagination
            totalResults={totalResults}
            resultsPerPage={resultsPerPage}
            label="Table navigation"
            onChange={onPageChange}
          />
        </TableFooter>
      </TableContainer>
    </div>
  );
};

export default OrdersTable;
